import { Button, Grid, Box } from '@mui/material';
import Container from '@mui/material/Container';
import React from 'react';
import { ReactComponent as verde } from '../jverde.svg';
import { ReactComponent as vermelho } from '../jvermelho.svg';

const Mapa = ({ data }) => {
    const gridItems = Array.from({ length: 120 }, (_, index) => (
        <Grid item key={index} xs={1}>
            {<IconButton id={index}> <img src={getOccupationStatus() ? '../jverde.svg' : '../jvermelho.svg'} /></IconButton>}
        </Grid>
    ));
    return (
        <React.Fragment>
            <Container>
                <Grid container rowSpacing={5} columnSpacing={5}>{gridItems}</Grid>
            </Container>
        </React.Fragment>
    );
}

export default Mapa;
